
function getSPHUID(){var x= Date.now(),r=performance&&performance.now&&1e3*performance.now()||0;return"xxxxxxxxxxxx4xxxyxxxxxxxxxxxxxxx".replace(/[xy]/g,function(e){var n=16*Math.random();return x>0?(n=(x+n)%16|0,x=Math.floor(x/16)):(n=(r+n)%16|0,r=Math.floor(r/16)),("x"===e?n:3&n|8).toString(16)})};
